import { Menu } from "antd";
import Link from "next/link";

const MenuNavibarLayout = ({ menus }) => {


  
  return (
    <Menu mode="horizontal">
      {menus.map((menu) => (
        <Menu.Item>
            <a>{menu}</a>
         
        </Menu.Item>
      ))}
    </Menu>
  );
};

export default MenuNavibarLayout;
